import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function UserDashboard() {
  const [docs, setDocs] = useState([]);
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');
  const [file, setFile] = useState(null);
  const [deadline, setDeadline] = useState(null);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchDocs();
    fetchDeadline();
  }, []);

  const fetchDocs = async () => {
    setLoading(true);
    try {
      const res = await axios.get('/api/documents/my', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setDocs(res.data);
    } catch (err) {
      setError('Failed to fetch documents');
    }
    setLoading(false);
  };

  const fetchDeadline = async () => {
    try {
      const res = await axios.get('/api/settings/deadline', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setDeadline(res.data.deadline_datetime);
    } catch {}
  };

  const handleUpload = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess('');
    const formData = new FormData();
    formData.append('title', title);
    formData.append('description', description);
    formData.append('file', file);
    try {
      await axios.post('/api/documents/upload', formData, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem('token')}`,
          'Content-Type': 'multipart/form-data'
        }
      });
      setSuccess('Upload successful!');
      setTitle('');
      setDescription('');
      setFile(null);
      fetchDocs();
    } catch (err) {
      setError(err.response?.data?.error || 'Upload failed');
    }
    setLoading(false);
  };

  return (
    <div className="min-h-screen bg-gray-50 p-4">
      <div className="max-w-2xl mx-auto">
        <div className="mb-4 p-4 bg-blue-100 rounded text-blue-700">
          Submission Deadline: {deadline ? new Date(deadline).toLocaleString() : 'Not set'}
        </div>
        <form className="bg-white p-4 rounded shadow mb-6" onSubmit={handleUpload}>
          <h2 className="text-xl font-bold mb-2">Upload Document</h2>
          <input type="text" placeholder="Title" value={title} onChange={e => setTitle(e.target.value)} className="mb-2 w-full p-2 border rounded" required />
          <textarea placeholder="Description" value={description} onChange={e => setDescription(e.target.value)} className="mb-2 w-full p-2 border rounded" />
          <input type="file" onChange={e => setFile(e.target.files[0])} className="mb-2 w-full" required />
          {error && <div className="text-red-500 mb-2">{error}</div>}
          {success && <div className="text-green-500 mb-2">{success}</div>}
          <button type="submit" className="bg-blue-500 text-white py-2 px-4 rounded" disabled={loading}>{loading ? 'Uploading...' : 'Upload'}</button>
        </form>
        <h2 className="text-xl font-bold mb-2">My Documents</h2>
        {loading ? <div>Loading...</div> : (
          <table className="w-full bg-white rounded shadow">
            <thead>
              <tr>
                <th className="p-2">Title</th>
                <th className="p-2">Uploaded</th>
                <th className="p-2">Viewed</th>
                <th className="p-2">Comment</th>
                <th className="p-2">Download</th>
              </tr>
            </thead>
            <tbody>
              {docs.map(doc => (
                <tr key={doc.id}>
                  <td className="p-2">{doc.title}</td>
                  <td className="p-2">{new Date(doc.upload_datetime).toLocaleString()}</td>
                  <td className="p-2">{doc.is_viewed ? 'Yes' : 'No'}</td>
                  <td className="p-2">{doc.admin_comment || '-'}</td>
                  <td className="p-2">
                    <a href={`/api/documents/download/${doc.id}`} target="_blank" rel="noopener noreferrer" className="text-blue-500 underline">Download</a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}
